import React from "react";

const Features = () => {
  return (
    <div>
      <section id="features">
        <div className="container">
          <div className="row">
            <div className="col-12">
                <h3 className="fs-5">Our Features</h3>
                <h1 className="display-6">Our <b>Awesome</b> Features</h1>
                <hr className="w-25 mx-auto"/>
            </div>
          </div>
          <div className="row">
            <div className="col-md-4">
                
            </div>
          </div>
        </div>
      </section>
    </div>
  );
};

export default Features;
